import React from "react";
import "./index.scss";

import ChartSolides from "../../../../../components/charts";

const SearchResults = ({ texts, data }) => {
    return (
        <div className="search-results-noAuth">
            <h2>Forma como busca resultados</h2>
            <p className="desc-profiler">
                {texts.forma_busca_resultados.texto}
            </p>
            <div>
                <ChartSolides
                    type="searchResults"
                    searchResults={{
                        voce: {
                            dominante: data[0].data[0].toFixed(2) + "%",
                            informal: data[0].data[1].toFixed(2) + "%",
                            condescendente: data[0].data[2].toFixed(2) + "%",
                            formal: data[0].data[3].toFixed(2) + "%"
                        },
                        meio: {
                            dominante: data[1].data[0].toFixed(2) + "%",
                            informal: data[1].data[1].toFixed(2) + "%",
                            condescendente: data[1].data[2].toFixed(2) + "%",
                            formal: data[1].data[3].toFixed(2) + "%"
                        },
                        flexibilidade: {
                            dominante: data[2].data[0].toFixed(2) + "%",
                            informal: data[2].data[1].toFixed(2) + "%",
                            condescendente: data[2].data[2].toFixed(2) + "%",
                            formal: data[2].data[3].toFixed(2) + "%"
                        }
                    }}
                />
            </div>
        </div>
    );
};

export default SearchResults;
